import React from 'react';
import { Grid, Card, CardContent, Typography, Link } from '@material-ui/core';
import Styles from './styles';
import AddCircleOutlinedIcon from '@material-ui/icons/AddCircleOutlined';

const FormRegister = props => {
	const classes = Styles();

	const showForm = e => {
		e.preventDefault();
	}

	return(
		<Grid item sm={4}>
			<Card className={classes.card}>
				<CardContent className={classes.content}>
					<Link href="#" onClick={showForm} className={classes.registro}>
						<AddCircleOutlinedIcon className={classes.iconreg} />
						<Typography className={classes.labelreg} variant='h5' component="h5">
							Agregar Nueva Ubicacion
						</Typography>
					</Link>
				</CardContent>
			</Card>
		</Grid>
	);
}

export default FormRegister;
